import { createRouter, createWebHistory } from 'vue-router'
import Accueil from '../views/Accueil.vue'

const routes = [{
        path: '/',
        component: Accueil
    },
    {
        path: '/visites',
        component: Visites
    },
    {
        path: '/medecin',
        component: Visites
    },
    {
        path: '/medicament',
        component: Visites
    }
]

const router = createRouter({
    history: createWebHistory(process.env.BASE_URL),
    routes
})

export default router
